class AppContainer extends Component {
	constructor(props) {
		super(props);
		console.log(props);
	}
	render() {
		return ( <
			Container fluid = {
				true
			} >
			<
			header > {
				this.props.children[0]
			} < /header> <
			main > {
				this.props.children[1]
			} < /main> <
			/Container>
		);
	}
}

export default AppContainer;
